// CardDisplay.js
import React from "react";

const CardDisplay = ({ currentCard, previousCard }) => {
  return (
    <div className="card-display">
      <img
        src={previousCard ? previousCard.image : "placeholder.jpg"}
        alt="Previous Card"
      />
      <img
        src={currentCard ? currentCard.image : "placeholder.jpg"}
        alt="Current Card"
      />
    </div>
  );
};

export default CardDisplay;
